		public System.Collections.Generic.List<string> CustomTableIds
		{
			get
			{
				return this.m_customTableIds;
			}
			set
			{
				this.m_customTableIds = value;
			}
		}

		public void Initialize(Document revitDocument)
		{
			this.InitializeAllTableInfos();
			this.InitializeExtraColumns(revitDocument);
		}

		private void InitializeExtraColumns(Document revitDocument)
		{
			if (Command.ExportImportConfig.IgnoreSharedParameters && Command.ExportImportConfig.IgnoreSharedParametersExceptions.Count == 0)
			{
				Log.WriteLine("Shared parameters will be ignored to export/import");
				return;
			}
			Log.WriteLine("Creating shared or project parameter columns");
			Log.Indent();
			BindingMap parameterBindings = revitDocument.ParameterBindings;
			DefinitionBindingMapIterator definitionBindingMapIterator = parameterBindings.ForwardIterator();
			definitionBindingMapIterator.Reset();
			int num = -1;
			while (definitionBindingMapIterator.MoveNext())
			{
				num++;
				ElementBinding elementBinding = definitionBindingMapIterator.Current as ElementBinding;
				if (elementBinding != null)
				{
					string name = definitionBindingMapIterator.Key.Name;
					bool flag = Command.ExportImportConfig.IgnoreSharedParametersExceptions.Contains(name);
					if ((!Command.ExportImportConfig.IgnoreSharedParameters && flag) || (Command.ExportImportConfig.IgnoreSharedParameters && !flag))
					{
						Log.WriteLine("Parameter is intended to be ignored [" + name + "]");
					}
					else
					{
						string text = null;
						if (!string.IsNullOrEmpty(name))
						{
							text = DatabaseManager.GetValidCoumnName(name);
						}
						if (string.IsNullOrEmpty(text))
						{
							Log.WriteWarning("Parameter will be ignored [" + name + "]");
						}
						else
						{
							if (text != definitionBindingMapIterator.Key.Name)
							{
								Log.WriteWarning("Parameter changed from [{0}] to [{1}] and it will be ignored when exporting/importing", new object[]
								{
									name,
									text
								});
							}
							DataType dataType = DataType.TEXT;
							ParameterType paramtype = 0;
							try
							{
								paramtype = definitionBindingMapIterator.Key.ParameterType;
							}
							catch
							{
								continue;
							}
							dataType = DatabaseManager.GetDataType(paramtype);
							foreach (Category category in elementBinding.Categories)
							{
								if (category != null)
								{
									int integerValue;
									try
									{
										integerValue = category.Id.IntegerValue;
									}
									catch (System.Exception)
									{
										Log.WriteNotice("Index: " + num + " Not be able to get category id");
										continue;
									}
									string tableKey = RDBResource.GetTableKey(integerValue, elementBinding is TypeBinding);
									if (base.ContainsKey(tableKey))
									{
										TableInfo tableInfo = base[tableKey];
										Log.WriteLine(tableInfo);
										bool flag2 = false;
										foreach (ColumnInfo current in tableInfo.Values)
										{
											if (current.Name.Equals(text))
											{
												flag2 = true;
												break;
											}
										}
										Log.Indent();
										if (!flag2)
										{
											tableInfo.AddColumn(new CustomColumnInfo(text, dataType));
											Log.WriteLine("Add column: " + text);
										}
										Log.Unindent();
									}
								}
							}
						}
					}
				}
			}
			Log.Unindent();
			Log.WriteLine("Finished creating shared or project parameter columns");
		}

		private TableInfo Register(TableInfo tableinfo)
		{
			base.Add(tableinfo.TableId, tableinfo);
			return tableinfo;
		}

		protected TableInfo RegisterCustom(TableInfo tableinfo)
		{
			if (Command.ConfigFile.DebugSQL)
			{
				Log.WriteLine(tableinfo.Name);
			}
			this.m_customTableIds.Add(tableinfo.TableId);
			return this.Register(tableinfo);
		}

		protected void Phases(TableInfo tableinfo)
		{
			tableinfo.WithColumn((BuiltInParameter)(-1012100), DataType.INTEGER).WithColumn((BuiltInParameter)(-1012101), DataType.INTEGER).WithForeignKey((BuiltInParameter)(-1012100), "TabN_OST_Phases_INSTANCE", (BuiltInParameter)(-1002100)).WithForeignKey((BuiltInParameter)(-1012101), "TabN_OST_Phases_INSTANCE", (BuiltInParameter)(-1002100));
		}

		protected void Symbol(TableInfo tableinfo, string foreignTable)
		{
			tableinfo.WithColumn((BuiltInParameter)(-1002000), DataType.INTEGER).WithForeignKey((BuiltInParameter)(-1002000), foreignTable, (BuiltInParameter)(-1002100));
		}

		protected void DesignOption(TableInfo tableinfo)
		{
			tableinfo.WithColumn((BuiltInParameter)(-1013201), DataType.INTEGER).WithForeignKey((BuiltInParameter)(-1013201), "TabN_OST_DesignOptions_INSTANCE", (BuiltInParameter)(-1002100));
		}

		protected void FromToSetup(TableInfo tableinfo, string fromTableId, string fromColumnId, string toTableId, string toColumnId)
		{
			tableinfo.WithColumn("ColN_CST_Id", DataType.INTEGER).WithColumn("ColN_CST_Name", DataType.TEXT).WithColumn("ColN_CST_HostId", DataType.INTEGER).WithColumn("ColN_CST_HostName", DataType.TEXT).WithPrimaryKey("ColN_CST_Id").WithForeignKey("ColN_CST_Id", fromTableId, fromColumnId).WithForeignKey("ColN_CST_HostId", toTableId, toColumnId);
		}

		protected void FromToSetup(TableInfo tableinfo, string fromTableId, string toTableId)
		{
			tableinfo.WithColumn("ColN_CST_Id", DataType.INTEGER).WithColumn("ColN_CST_Name", DataType.TEXT).WithColumn("ColN_CST_HostId", DataType.INTEGER).WithColumn("ColN_CST_HostName", DataType.TEXT).WithPrimaryKey("ColN_CST_Id").WithForeignKey("ColN_CST_Id", fromTableId, (BuiltInParameter)(-1002100)).WithForeignKey("ColN_CST_HostId", toTableId, (BuiltInParameter)(-1002100));
